  <div style="width: 916px; height: 214px; text-align: center; color: #800080; font-size: 35px; font-family: Hind Madurai; font-weight: 400; word-wrap: break-word">Haarlem Jazz!  Get ready for an unforgettable weekend filled with soulful melodies, vibrant rhythms, and world-class musicians! Whether youre here to experience jazz legends or discover rising stars, Haarlem Jazz offers you four days of nonstop music and magic across the historic streets and stunning venues of Haarlem.<br/><br/>Immerse yourself in the rich traditions of jazz, from smooth swing to lively bebop, and explore a lineup that celebrates the diversity of this iconic genre. Stroll through open-air performances, intimate club sessions, and captivating concerts in the heart of our beautiful city.<br/><br/>Explore the schedule, enjoy the atmosphere, and let Haarlem Jazz ignite your passion for music. Lets make this a festival to remembersee you on the streets of Haarlem!</div>
